insert  into `base_message`(`id`,`title`,`content`,`ip`,`location`,`create_time`,`is_show`,`creator`) values (1,'我的第一条留言信息','<p></p><div><img src=\"http://localhost:8080/resources/layui/images/face/2.gif\" alt=\"[哈哈]\"><br></div><p><span>《弗林德斯大学毕业证》【微/Q:194107318】《Flinders学历文凭》【WeChat:194107318】原版制作《大学毕业证书成绩单、学历证明》【留信网认证，本科，硕士，海归，博士，排名，成绩单】代办国外（海外）澳洲英国、澳洲、韩国、美国、新西兰等各大学毕业证。</span></p><span>《弗林德斯大学学位证》【微/Q:194107318——WeChat:194107318】《弗林德斯大学学历》【留信网认证，本科，硕士，海归，博士，排名，成绩单】代办国外（海外）澳洲、英国、澳洲、韩国、美国、新西兰等各Cumbria坎布里亚大学毕业证。十五年致力于帮助留学生解决无法毕业，无法认证真实的难题；并帮助留学生制作国外大学毕业证（微，Q:194107318），成绩单，真实认证、成绩单以及回国所需的真实学位真实认证。</span><br><span>《弗林德斯本科毕业证书》【WeChat::194107318】《大学成绩单、学历证明》中新网客户端11月21日电(李金磊)交通运输部会同国家发改委21日印发《关于深化道路运输价格改革的意见》，明确符合条件的儿童乘坐客运班车享受免费乘车或者客票半价优待。在儿童身高标准基础上，增加以年龄为依据的儿童票、免票划分标准。</span><br><span>具体条件为：每一成人旅客可携带1名6周岁(含6周岁)以下或者身高1.2米(含1.2米)以下、且不单独占用座位的儿童免费乘车，需单独占用座位或者超过1名时超过的人数执行客票半价优待，并提供座位；6～14周岁或者身高为1.2～1.5米的儿童乘车执行客票半价优待，并提供座位。</span><p></p>','125.123.123','江西','2019-11-23 17:31:50',1,'系统管理员'),(2,'我的第二条留言信息','<p><b>我的第二条留言信息<img src=\"http://localhost:8080/resources/layui/images/face/26.gif\" alt=\"[怒]\"></b></p><p><i>layer</i>是一款近年来备受青睐的web弹层组件，她具备全方位的解决方案，致力于服务各水平段的开发人员，您的页面会轻松地拥有丰富友好的操作体验。</p><p>在与同类组件的比较中，<i>layer</i>总是能轻易获胜。她尽可能地在以更少的代码展现更强健的功能，且格外注重性能的提升、易用和实用性，正因如此，越来越多的开发者将媚眼投上了<i>layer</i>（已被<em id=\"sees\">10215887</em>人次关注）。<i>layer</i>&nbsp;甚至兼容了包括 IE6 在内的所有主流浏览器。她数量可观的接口，使得您可以自定义太多您需要的风格，每一种弹层模式各具特色，广受欢迎。当然，这种“王婆卖瓜”的陈述听起来总是有点难受，因此你需要进一步了解她是否真的如你所愿。</p><p><i>layer</i>&nbsp;采用 MIT 开源许可证，<em>将会永久性提供无偿服务</em>。因着数年的坚持维护，截至到2017年9月13日，已运用在超过&nbsp;<em>30万</em>&nbsp;家 Web 平台，其中不乏众多知名大型网站。目前 layer 已经成为国内乃至全世界最多人使用的 Web 弹层解决方案，并且她仍在与 Layui 一并高速发展。<a href=\"http://fly.layui.com/\" target=\"_blank\"><em>Fly</em></a></p>','0:0:0:0:0:0:0:1','内网IP|0|0|内网IP|内网IP','2019-11-23 18:45:24',1,'zhangyukang'),(3,'我的第三条留言 信息[泪]','<p>我的第三条留言 信息<img src=\"http://localhost:8080/resources/layui/images/face/12.gif\" alt=\"[泪]\"></p>','0:0:0:0:0:0:0:1','内网IP|0|0|内网IP|内网IP','2019-11-23 18:47:13'