/*Table structure for table `job_sick_paper` */

DROP TABLE IF EXISTS `job_sick_paper`;

CREATE TABLE `job_sick_paper` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(200) NOT NULL COMMENT '请假单标题',
  `content` text NOT NULL COMMENT '请假单内容',
  `days` int(255) NOT NULL COMMENT '请假天数',
  `start` date NOT NULL COMMENT '开始日期',
  `end` date NOT NULL COMMENT '结束日期',
  `user_id` bigint(20) NOT NULL COMMENT '请假人',
  `status` int(10) NOT NULL DEFAULT '0' COMMENT '审批状态：0：未提交，1：已提交，2：审批中，3：通过，4：未通过，5：放弃',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modified_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8mb4;

