/*Table structure for table `sys_dept` */

DROP TABLE IF EXISTS `sys_dept`;

CREATE TABLE `sys_dept` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '部门ID',
  `parent_id` bigint(20) NOT NULL COMMENT '上级部门ID',
  `dept_name` varchar(100) NOT NULL COMMENT '部门名称',
  `order_number` bigint(20) DEFAULT NULL COMMENT '排序',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modified_time` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '部门备注',
  `phone` varchar(255) DEFAULT NULL COMMENT '电话',
  `count` bigint(20) DEFAULT NULL COMMENT '部门人数',
  `address` varchar(255) DEFAULT NULL COMMENT '部门地址',
  `is_open` int(2) DEFAULT '0' COMMENT '0:不展开，1：展开',
  `dept_num` varchar(100) NOT NULL COMMENT '部门编号',
  PRIMARY KEY (`id`) USING BTREE
